INSERT INTO `craft_matrixcontent_introblock` (`id`, `elementId`, `locale`, `field_block_style`, `field_block_body`, `field_block_button`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '61', 'en_gb', 'std', '<p>Curabitur non nulla sit amet nisl tempus convallis quis ac lectus. Sed porttitor lectus nibh. Quisque velit nisi, pretium ut lacinia in, elementum id enim. Cras ultricies ligula sed magna dictum porta.</p>', '{\"type\":\"entry\",\"custom\":\"\",\"entry\":[\"2\"],\"asset\":\"\",\"customText\":\"Fancy link\",\"target\":\"\"}', '2016-09-09 11:18:28', '2016-09-09 15:39:37', '765f82b6-0ff3-4f4f-b44b-4e2500db52af'),
 ('2', '81', 'en_gb', 'std', '<p>Croxley Park is more than just a great place to do business. We’re an impressive headquarters for international companies, and a flexible home for local start-ups. \n\nWe’re also a thriving community, a well-connected hub \n\nand a relaxing haven. Expect much more at Croxley Park.   </p>', '{\"type\":\"entry\",\"custom\":\"\",\"entry\":[\"2\"],\"asset\":\"\",\"customText\":\"Read more\",\"target\":\"\"}', '2016-09-12 14:41:09', '2016-09-13 16:18:38', 'ac568daa-27c8-425b-984b-d392477c9c80'),
 ('3', '93', 'en_gb', 'small', '<h2 class=\"intro__heading--dark\">Amenities</h2>\n\n<p>Ratione irure perferendis. Parturient dignissim fermentum accumsan incididunt iaculis lacinia ipsam vero, mollis at consequatur eum eiusmod rem. Ultrices eius platea expedita iure molestie, vero occaecat vulputate nostra, class deleniti.</p>', '', '2016-09-12 15:52:32', '2016-09-13 14:10:33', '49f6ad48-329a-4ec7-a4d6-b04e7bef837e'),
 ('4', '123', 'en_gb', 'sub', '<h2><span class=\"t-brand\">Latest Events</span></h2><p>Regular and varied events are scheduled to make the most of our amazing setting, amenities and strengthen our sense of community. So whether you enjoy team building, networking, relaxing, listening or watching we look forward to you joining us.</p>', '', '2016-09-12 16:33:26', '2016-09-13 16:00:28', '2de6db60-e84c-41a3-9787-33e409b4015e'),
 ('5', '124', 'en_gb', 'std', '<h2><span class=\"t-brand\">Latest News</span></h2><p>There’s always something going on at Croxley Park. Make sure you keep up to date by getting the latest news, events and more direct to your inbox.</p>', '', '2016-09-13 15:45:14', '2016-09-13 15:45:14', '93160d48-7bce-4703-a7bf-8a9b2a795acc');
